function App() {
  return (
    <Router>
      <Switch>
         <Route exact path= "/" component={Login}/>
         <Route exact path= "/new_account" component={NewAccount}/>
         <Route exact path= "/projects" component={Projects}/>
      </Switch>
    </Router>     
  );
}

export default App;
